import React from 'react'
function Home() {
    const box={
        width:'70%',
        height:'60vh',
        backgroundColor:'grey',
        position:'absolute',
        top:'180px',
        marginRight:'15%',
        marginLeft:'15%', 
        dropShadow:'0px 20px 20px black'

    }
    
    
    
    return (
        <div>
           <div style={box}>
            
           </div>
                          

        </div>
    )
}

export default Home
